module aes_engine ( clk, rst_, din, cmd, interface_ready, dout, data_ok );
  input [7:0] din;
  input [1:0] cmd;
  output [7:0] dout;
  input clk, rst_;
  output interface_ready, data_ok;
  wire   transformer_done_w, key_start, transformer_start_w, output_read_w;
  wire   [127:0] plain;
  wire   [127:0] key;
  wire   [127:0] round0_key_w;
  wire   [127:0] round1_key_w;
  wire   [127:0] round2_key_w;
  wire   [127:0] round3_key_w;
  wire   [127:0] round4_key_w;
  wire   [127:0] round5_key_w;
  wire   [127:0] round6_key_w;
  wire   [127:0] round7_key_w;
  wire   [127:0] round8_key_w;
  wire   [127:0] round9_key_w;
  wire   [127:0] round10_key_w;
  wire   [127:0] cipher;

  input_interface input_module ( .clk(clk), .rst_(rst_), .din(din), .cmd(cmd), 
        .ready(interface_ready), .transformer_done(transformer_done_w), 
        .key_start(key_start), .plain_out(plain), .key_out(key) );
  engine_key_generator key_gen_module ( .rst_(rst_), .clk(clk), .key_in(key), 
        .key_start(key_start), .transformer_start(transformer_start_w), 
        .round0_key(round0_key_w), .round1_key(round1_key_w), .round2_key(
        round2_key_w), .round3_key(round3_key_w), .round4_key(round4_key_w), 
        .round5_key(round5_key_w), .round6_key(round6_key_w), .round7_key(
        round7_key_w), .round8_key(round8_key_w), .round9_key(round9_key_w), 
        .round10_key(round10_key_w) );
  engine_round_transformer transformer_module ( .rst_(rst_), .clk(clk), 
        .plaintext(plain), .transformer_start(transformer_start_w), 
        .round0_key(round0_key_w), .round1_key(round1_key_w), .round2_key(
        round2_key_w), .round3_key(round3_key_w), .round4_key(round4_key_w), 
        .round5_key(round5_key_w), .round6_key(round6_key_w), .round7_key(
        round7_key_w), .round8_key(round8_key_w), .round9_key(round9_key_w), 
        .round10_key(round10_key_w), .output_read(output_read_w), .ciphertext(
        cipher), .transformer_done(transformer_done_w) );
  output_interface output_module ( .rst_(rst_), .clk(clk), .transformer_done(
        transformer_done_w), .ciphertext(cipher), .data_out(dout), .data_ok(
        data_ok), .output_read(output_read_w) );
endmodule


